import React from "react";
import {Table/*, Input */} from "reactstrap";
import {Edit, Trash2} from "react-feather";

import coffeeMug from "../../../assets/img/elements/01.png";
import camera from "../../../assets/img/elements/11.png";
import headphone from "../../../assets/img/elements/07.png";
import beer from "../../../assets/img/elements/14.png";
import penDrive from "../../../assets/img/elements/04.png";
import photo6 from "../../../assets/images/empty_product.svg";
import Translate from "../../../Translate";
import EditButton from "../../../components/buttons/editButton";
import DeleteButton from "../../../components/buttons/deleteButton";

/*name change example to TableComponent*/

export default class TableComponent extends React.Component {
    render() {
        return (
            <Table responsive>
                <thead>
                <tr>
                    <th>Նկար</th>
                    <th>Անվանում</th>
                    <th>Բարկոդ</th>
                    <th>ԱՊՄ</th>
                    <th>Ակտիվ</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {
                    this.props.data ?
                        this.props.data.map(
                            product => {

                                return (
                                    <tr
                                        key={product.id}
                                    >
                                        <th scope="row">
                                            <img
                                                style={{height: 60}}
                                                src={
                                                    product.image ?
                                                        product.image
                                                        :
                                                        photo6
                                                }
                                                alt="product-icon"
                                            />
                                        </th>
                                        <td>{product.name}</td>
                                        <td>{product.barcode.barcode}</td>
                                        <td>
                                            {
                                                product.apm ?
                                                    product.apm
                                                    :
                                                    '-'
                                            }
                                        </td>
                                        <td>
                                            {
                                                product.active ?
                                                    <Translate name={'active'}/>
                                                    :
                                                    <Translate name={'inactive'}/>
                                            }
                                        </td>
                                        <td>
                                            <EditButton perm={'Edit'}/>
                                            <DeleteButton perm={'Delete'}/>
                                        </td>
                                    </tr>
                                )
                            }
                        )
                        :
                        null
                }
                </tbody>
            </Table>
        );
    }
}
